  return (
    <div>
      <h2>{props.section}</h2>
      <div
        className="card"
        css={css`
          text-align: left;
          & h5,
          & h6,
          & p,
          & ul,
          & li {
            margin: 0;
            font-size: 16px;
          }

          & p {
            margin-left: 20px;
          }

          & ul {
            list-style: none;
            padding-left: 3px;
          }

          & ul li::before {
            content: " - ";
          }

          & h6 span {
            color: #0080c6;
            font-weight: 700;
          }

          & h5 span {
            font-family: "Barlow Condensed";
            font-weight: 400;
          }

          ${props.styles};
        `}
        // dangerouslySetInnerHTML={{ __html: props.content }}
      >
        <ul>
          <li>
            Member of UCLA Men's Ultimate Frisbee Team
            <li>Receipient of UCLA Alumni Association scholarship</li> Volunteer
            for UCLA Housing and Bruin Overnight Program
          </li>
        </ul>
      </div>
    </div>
  );
}
